INSERT INTO `blogs` (`id`, `title`, `slug`, `description`, `short_description`, `banner`, `created_at`, `updated_at`) VALUES
(104, 'Hướng dẫn sử dụng Mchose GX87', 'huong-dan-su-dung-mchose-gx87', '<p>Nihao! <a href=\"https://kicap.vn/mchosegx87-ban-phim-co-khung-nhom-tkl-3-mode-co-ta\">Mchose GX87</a> là một trong những chiếc bàn phím ngon ở phân khúc. Với thiết kế layout TKL, đèn nền RGB, 3 chế độ,.... Mchose GX87 chắc chắn sẽ làm người dùng thấy thỏa mãn khi sử dụng. KICAP rất hân hạnh được đồng hành cùng Mchose mang tới sản phẩm này tới tay người dùng.</p><p>Hãng cũng cung cấp một quyển sổ hướng dẫn sử dụng chi tiết với rất nhiều thứ tiếng. Tuy nhiên để tiện theo dõi và sử dụng, KICAP sẽ tóm tắt lại những tip sử dụng chính cho mọi người dễ hiểu.</p><p>&nbsp;</p><blockquote><strong>Tuyên bố trách nhiệm</strong>: <em>Bài viết này chỉ hướng dẫn cho anh em cách sử dụng bàn phím. KICAP chỉ tiếp nhận và giải đáp những thắc mắc về lỗi bàn phím khi mọi người mua bàn phím bên shop KICAP</em><em>Tất cả các sản phẩm mua ở bên cửa hàng khác quý khách vui lòng liên hệ trực tiếp với họ để được phục vụ.</em><em>Các đơn hàng quý khách mua trên sàn tmđt như shopee, lazada, tiktok vui lòng inbox trực tiếp cho gian hàng tránh liên hệ nhầm cửa hàng nhé!</em><em>Trân trọng cảm ơn anh em &lt;3</em></blockquote><p>&nbsp;</p><p><strong><em>I. Cài đặt phần mềm, driver&nbsp;</em></strong></p><p><strong>Link tải phần mềm cho window: </strong><a href=\"https://1drv.ms/u/c/4369e28698355db0/EZBb70DA8UFBv_APRsACIicB1Uh0r2Czl0RxLEFVecrlfg?e=Owft5Q\"><strong><em>Mchoose Hub</em></strong></a></p><p>Sau khi tải phần mềm, các bạn kết nối bàn phím với máy tính qua dây cáp USB của hãng cung cấp (không kết nối bằng bluetooth hoặc wireless 2.4). Sau đó, bật phần mềm lên và thực hiện chỉnh LED cũng như keymap theo nhu cầu sử dụng của cá nhân. Trong trường hợp có phiên bản firmware mới thì các bạn cần đảm bảo kết nối dây USB ổn định thì mới cập nhật.</p><p><strong><em>II. Điều chỉnh chế độ kết nối với các thiết bị</em></strong></p><p><strong>Kết nối Bluetooth (gạt công tắc ở mặt dưới bàn phím sang B):</strong></p><p><strong>① </strong>Nhấn và giữ đồng thời phím FN + W trong 3 giây.</p><p><strong>②</strong> Mở thiết bị cần kết nối Bluetooth (chẳng hạn như điện thoại di động, máy vi tính).</p><p><strong>③</strong> Tìm tên GX87 3.0 hoặc GX87 5.0 và kết nối.</p><p><strong>Kết nối Wireless 2.4G (gạt công tắc ở mặt dưới bàn phím sang 2.4G):</strong></p><p>Hãng thiết kế chỗ để đầu thu wireless ở ngay ở cạnh chỗ công tắc BT</p><p>Cắm đầu thu vào cổng USB máy tính là có thể sử dụng được rồi.</p><p><strong>Kết nối bằng dây (gạt công tắc ở mặt dưới bàn phím về vị trí giữa OFF):</strong></p><p>Cắm dây và sử dụng.</p><p><strong>I</strong><strong><em>I. Các tổ hợp phím tắt thường dùng</em></strong></p><p><strong>F</strong>N + A : Chế độ Mac</p><p><strong>F</strong>N + S : Chế độ Win</p><p><strong>F</strong>N + ESC: reset lại phím</p><p><strong>F</strong>N + WIN (bên trái): Khoá hoặc mở khoá phím WIN&nbsp;</p><p><strong>F</strong>N + += :&nbsp; Thay đổi chế độ LED trên bàn phím</p><p><strong>F</strong>N + _- : Thay đổi màu LED&nbsp;</p><p><strong>F</strong>N + điều hướng lên: Tăng độ sáng LED</p><p><strong>F</strong>N + điều hướng xuống: Giảm độ sáng LED</p><p><strong>F</strong>N + điều hướng trái: Giảm tốc độ nháy LED</p><p><strong>F</strong>N + điều hướng phải: Tăng tốc độ nháy LED&nbsp;</p><p><strong>F</strong>N + /? : Đổi màu LED trạng thái</p><p><strong>F</strong>N + ,&lt; : Tăng độ sáng LED trạng thái</p><p><strong>F</strong>N + .&gt; : Giảm độ sáng LED trạng thái</p><p><strong>F</strong>N + Shift phải : Đổi chế độ sáng LED trạng thái</p><p><strong>F</strong>N + Shift trái : Đổi LED trạng thái sang chế độ sạc</p><p><strong><em>IV. Các TIPS và lưu ý nhỏ trong quá trình sử dụng</em></strong></p><p>Khi thấy nút Alt và Win đổi chỗ cho nhau tức là bạn ở chế độ MAC</p><p><strong>Lưu ý:</strong> luôn luôn sạc bàn phím thông qua cổng USB của máy tính, không sạc bằng cái củ sạc khác như sạc dự phòng, sạc laptop, tai nghe, điện thoại v.v</p><p><strong>Còn nếu bạn là người mới chơi, chưa tìm hiểu nhiều về bàn phím cũng như cách mods phím cơ, hay inbox cho Kicap để được tư vấn cụ thể nhiệt tình nhất. Zài jiàn!</strong></p>', 'Nihao! Mchose GX87 là một trong những chiếc bàn phím ngon ở phân khúc. Với thiết kế layout TKL, đèn nền RGB, 3 chế độ,.... Mchose GX87 chắc chắn sẽ làm người dùng thấy thỏa mãn khi sử dụng. KICAP rất hân hạnh được đồng hành cùng Mchose mang tới sản phẩm này tới tay người dùng.', '01JA9GE3V3ST7BKQXT3W2969M5.png', '2024-10-16 01:52:46', '2024-10-16 01:52:46'),
(105, 'Hướng dẫn sử dụng Mchose GX871', 'huong-dan-su-dung-mchose-gx871', '<p>Nihao! <a href=\"https://kicap.vn/mchosegx87-ban-phim-co-khung-nhom-tkl-3-mode-co-ta\">Mchose GX87</a> là một trong những chiếc bàn phím ngon ở phân khúc. Với thiết kế layout TKL, đèn nền RGB, 3 chế độ,.... Mchose GX87 chắc chắn sẽ làm người dùng thấy thỏa mãn khi sử dụng. KICAP rất hân hạnh được đồng hành cùng Mchose mang tới sản phẩm này tới tay người dùng.</p><p>Hãng cũng cung cấp một quyển sổ hướng dẫn sử dụng chi tiết với rất nhiều thứ tiếng. Tuy nhiên để tiện theo dõi và sử dụng, KICAP sẽ tóm tắt lại những tip sử dụng chính cho mọi người dễ hiểu.</p><p>&nbsp;</p><blockquote><strong>Tuyên bố trách nhiệm</strong>: <em>Bài viết này chỉ hướng dẫn cho anh em cách sử dụng bàn phím. KICAP chỉ tiếp nhận và giải đáp những thắc mắc về lỗi bàn phím khi mọi người mua bàn phím bên shop KICAP</em><em>Tất cả các sản phẩm mua ở bên cửa hàng khác quý khách vui lòng liên hệ trực tiếp với họ để được phục vụ.</em><em>Các đơn hàng quý khách mua trên sàn tmđt như shopee, lazada, tiktok vui lòng inbox trực tiếp cho gian hàng tránh liên hệ nhầm cửa hàng nhé!</em><em>Trân trọng cảm ơn anh em &lt;3</em></blockquote><p>&nbsp;</p><p><strong><em>I. Cài đặt phần mềm, driver&nbsp;</em></strong></p><p><strong>Link tải phần mềm cho window: </strong><a href=\"https://1drv.ms/u/c/4369e28698355db0/EZBb70DA8UFBv_APRsACIicB1Uh0r2Czl0RxLEFVecrlfg?e=Owft5Q\"><strong><em>Mchoose Hub</em></strong></a></p><p>Sau khi tải phần mềm, các bạn kết nối bàn phím với máy tính qua dây cáp USB của hãng cung cấp (không kết nối bằng bluetooth hoặc wireless 2.4). Sau đó, bật phần mềm lên và thực hiện chỉnh LED cũng như keymap theo nhu cầu sử dụng của cá nhân. Trong trường hợp có phiên bản firmware mới thì các bạn cần đảm bảo kết nối dây USB ổn định thì mới cập nhật.</p><p><strong><em>II. Điều chỉnh chế độ kết nối với các thiết bị</em></strong></p><p><strong>Kết nối Bluetooth (gạt công tắc ở mặt dưới bàn phím sang B):</strong></p><p><strong>① </strong>Nhấn và giữ đồng thời phím FN + W trong 3 giây.</p><p><strong>②</strong> Mở thiết bị cần kết nối Bluetooth (chẳng hạn như điện thoại di động, máy vi tính).</p><p><strong>③</strong> Tìm tên GX87 3.0 hoặc GX87 5.0 và kết nối.</p><p><strong>Kết nối Wireless 2.4G (gạt công tắc ở mặt dưới bàn phím sang 2.4G):</strong></p><p>Hãng thiết kế chỗ để đầu thu wireless ở ngay ở cạnh chỗ công tắc BT</p><p>Cắm đầu thu vào cổng USB máy tính là có thể sử dụng được rồi.</p><p><strong>Kết nối bằng dây (gạt công tắc ở mặt dưới bàn phím về vị trí giữa OFF):</strong></p><p>Cắm dây và sử dụng.</p><p><strong>I</strong><strong><em>I. Các tổ hợp phím tắt thường dùng</em></strong></p><p><strong>F</strong>N + A : Chế độ Mac</p><p><strong>F</strong>N + S : Chế độ Win</p><p><strong>F</strong>N + ESC: reset lại phím</p><p><strong>F</strong>N + WIN (bên trái): Khoá hoặc mở khoá phím WIN&nbsp;</p><p><strong>F</strong>N + += :&nbsp; Thay đổi chế độ LED trên bàn phím</p><p><strong>F</strong>N + _- : Thay đổi màu LED&nbsp;</p><p><strong>F</strong>N + điều hướng lên: Tăng độ sáng LED</p><p><strong>F</strong>N + điều hướng xuống: Giảm độ sáng LED</p><p><strong>F</strong>N + điều hướng trái: Giảm tốc độ nháy LED</p><p><strong>F</strong>N + điều hướng phải: Tăng tốc độ nháy LED&nbsp;</p><p><strong>F</strong>N + /? : Đổi màu LED trạng thái</p><p><strong>F</strong>N + ,&lt; : Tăng độ sáng LED trạng thái</p><p><strong>F</strong>N + .&gt; : Giảm độ sáng LED trạng thái</p><p><strong>F</strong>N + Shift phải : Đổi chế độ sáng LED trạng thái</p><p><strong>F</strong>N + Shift trái : Đổi LED trạng thái sang chế độ sạc</p><p><strong><em>IV. Các TIPS và lưu ý nhỏ trong quá trình sử dụng</em></strong></p><p>Khi thấy nút Alt và Win đổi chỗ cho nhau tức là bạn ở chế độ MAC</p><p><strong>Lưu ý:</strong> luôn luôn sạc bàn phím thông qua cổng USB của máy tính, không sạc bằng cái củ sạc khác như sạc dự phòng, sạc laptop, tai nghe, điện thoại v.v</p><p><strong>Còn nếu bạn là người mới chơi, chưa tìm hiểu nhiều về bàn phím cũng như cách mods phím cơ, hay inbox cho Kicap để được tư vấn cụ thể nhiệt tình nhất. Zài jiàn!</strong></p>', 'Nihao! Mchose GX87 là một trong những chiếc bàn phím ngon ở phân khúc. Với thiết kế layout TKL, đèn nền RGB, 3 chế độ,.... Mchose GX87 chắc chắn sẽ làm người dùng thấy thỏa mãn khi sử dụng. KICAP rất hân hạnh được đồng hành cùng Mchose mang tới sản phẩm này tới tay người dùng.', '01JA9GE3V3ST7BKQXT3W2969M5.png', '2024-10-16 01:52:46', '2024-10-16 01:52:46'),
