(407, NULL, 'Bàn phím cơ Lucky65 v2 | Only KIT 1.6mm', '123123 e123123', 'ban-phim-co-lucky65-v2-only-kit-1-6mm', '[\"products/01JA5FPD38PSQV73JVRS5BK22C.png\",\"products/01JA5FPD3NYKVPSRBR8VDKP0XG.png\",\"products/01JA5FPD3T35ZMTYA7P3AT4HF8.png\"]', '<p><strong>🔖 Dự kiến hàng về: 1 tháng</strong></p><p><strong>🔖 Cách thức đặt hàng:</strong></p><ol><li>Lựa chọn màu sắc và thêm vào giỏ hàng</li><li>Bấm \"Thanh toán đơn hàng\" và điển thông tin nhận hàng</li><li>Chọn phương thức thanh toán COD</li><li>Chuyển khoản cọc 200.000K vào STK: TECHCOMBANK - 5685206688 - HOANG VAN MANH, ghi chú mã đơn hàng + SĐT đặt hàng</li><li>Khi hàng về tới shop, Shop chủ động liên hệ cho quý khách thông qua sđt đặt hàng.</li></ol><p><strong>🔖 Thông tin sản phẩm:</strong></p><ul><li>Tên bàn phím: Lucky65 v2</li><li>Loại: CNC Aluminum Mechanical Keyboard</li><li>Layout: 65% Layout, 67nút&nbsp;</li><li>PCB: mạch xuôi, LED RGB <strong>1.6mm non flexcut</strong></li><li>App<strong>: QMK/VIA</strong></li><li><strong>Tạ đáy thép pha lê</strong></li><li>Kiểu mount: Gasket Mounted</li><li>Dung lượng PIN: 3750mAh</li><li>Kết nối: Wired Type-C/Bluetooth/2.4G Wireless</li><li>Khối lượng: 1205g/2.66lb</li><li>Hot Swappable: 5 Pin</li><li>Kích thước: 326 x 115 x 33mm</li><li>Cấu trúc ball-catch dễ dàng tháo lắp</li><li>Badge nam châm, khoang cất receiver nằm dưới badge</li><li>Kit có sẵn đầy đủ foam</li><li><em>Kicap hỗ trợ build sẵn full phím cho anh em theo yêu cầu&nbsp;</em></li></ul>', 1420166, 1, 0, 1, 0, '2024-10-14 10:05:08', '2024-10-23 13:26:45', NULL, '', 2, 1416307),
