(1, '183 HT44 phường Hiệp Thành Quận 12', '0355198659', 'hoangtlhps26819@fpt.edu.vn', 'THE BABU', '© Copyright 2024 | THE BABU| All Rights Reserved', '01JB5X7YQF7QD4GEN6XTEW44PY.png', '<p>Quy định này được lập ra với mục đích nêu rõ các điều khoản, quyền lợi, nghĩa vụ và trách nhiệm của người mua và người bán khi sử dụng các dịch vụ được cung cấp tại trang web Webgiadung.com<br><br><strong>1. Đối với người bán:</strong><br>+ Cam kết bán các sản phẩm chất lượng<br>+ Cam kết bảo mật thông tin của khách hàng, không tiết lộ cho bên thứ 3.<br>+ Cam kết bảo hành trong thời gian bảo hành, lỗi 1 đổi 1 nếu lỗi thuộc về nhà sản xuất.<br>+ Bảo đảm quá trình mua hàng &amp; thanh toán của khách hàng diễn ra an toàn.<br> <br><strong>2.&nbsp; Đối với người mua:</strong><br>+ Người mua có trách nhiệm thanh toán đầy đủ tiền hàng, phí vận chuyển (nếu có) cho sản phẩm đã chấp nhận mua hàng &amp; thanh toán.<br>+ Cam kết chỉ mua hàng phục vụ cho nhu cầu &amp; mục đích cá nhân, phi mậu dịch, theo Quy định của Pháp luật Việt Nam.<br>+ Tìm hiểu kĩ càng thông tin về sản phẩm, hàng hóa muốn đặt mua trước khi chấp nhận mua hàng &amp; thanh toán, tránh trường hợp không đúng nhu cầu.<br>+ Khách hàng được phép khiếu nại và yêu cầu bảo hành, đổi – trả hàng hóa nếu hàng hóa nhận thuộc về lỗi của nhà sản xuất trong thời gian bảo hành quy định.<br><br><strong>Điều kiện bảo hành:</strong><br><br>+ Sản phẩm còn nguyên tem, nhãn mác, bao bì và phụ kiện kèm theo.<br><br>+ Lỗi sản phẩm do linh kiện hoặc do nhà sản xuất.<br><br>– Lưu ý , chúng tôi không nhận bảo hành trong các trường hợp sau:<br><br>+ Sản phẩm bị xây xát, rách, vỡ, trầy xước do khách hàng sử dụng không đúng cách, đánh rơi, làm vỡ.<br><br>+ Sản phẩm bị chập, cháy dây, linh phụ kiện do khách hàng không sử dụng đúng cách theo hướng dẫn của nhà sản xuất.<br><br>+ Sản phẩm đã quá thời gian bảo hành đổi trả.<br><br>Chính Sách Đổi Trả Hàng Khi Mua Hàng Tại Webgiadung.com<br><br>Để đảm bảo sự hài lòng của khách hàng khi mua sắm tại Webgiadung.com, Webgiadung.com nhận đổi trả hàng hoặc bảo hành lỗi 1 đổi 1 trong vòng 7 ngày kể từ khi khách hàng nhận sản phẩm (đổi sản phẩm mới trong trường hợp không sửa chữa được).<br><br><strong>Điều kiện đổi trả:</strong><br><br>+ Sản phẩm chưa quả sử dụng, còn nguyên tem, nhãn mác, bao bì và phụ kiện kèm theo.<br><br>+ Lỗi sản phẩm do linh kiện hoặc do nhà sản xuất</p>', '<p>HƯỚNG DẪN MUA HÀNG<br>Bước 1: Truy cập website và lựa chọn sản phẩm cần mua để mua hàng<br>Bước 2:&nbsp; Click và sản phẩm muốn mua, màn hình hiển thị ra pop up với các lựa chọn sau:<br>Nếu bạn muốn tiếp tục mua hàng: Bấm vào phần tiếp tục mua hàng để lựa chọn thêm sản phẩm vào giỏ hàng<br>Nếu bạn muốn xem giỏ hàng để cập nhật sản phẩm: Bấm vào xem giỏ hàng<br>Nếu bạn muốn đặt hàng và thanh toán cho sản phẩm này vui lòng bấm vào: Đặt hàng và thanh toán<br>Bước 3: Lựa chọn thông tin tài khoản thanh toán<br>Nếu bạn đã có tài khoản vui lòng nhập thông tin tên đăng nhập là email và mật khẩu vào mục đã có tài khoản trên hệ thống<br>Nếu bạn chưa có tài khoản và muốn đăng ký tài khoản vui lòng điền các thông tin cá nhân để tiếp tục đăng ký tài khoản. Khi có tài khoản bạn sẽ dễ dàng theo dõi được đơn hàng của mình<br>Nếu bạn muốn mua hàng mà không cần tài khoản vui lòng nhấp chuột vào mục đặt hàng không cần tài khoản<br>Bước 4: Điền các thông tin của bạn để nhận đơn hàng, lựa chọn hình thức thanh toán và vận chuyển cho đơn hàng của mình<br>Bước 5: Xem lại thông tin đặt hàng, điền chú thích và gửi đơn hàng<br>Sau khi nhận được đơn hàng bạn gửi chúng tôi sẽ liên hệ bằng cách gọi điện lại để xác nhận lại đơn hàng và địa chỉ của bạn.<br>Trân trọng cảm ơn.</p>', '<p><strong>1 - Giao hàng và thanh toán bằng tiền mặt tại nhà:</strong><br>- Các yêu cầu giao hàng tại nhà cần có thông tin chính xác về người nhận, địa chỉ, số điện thoại. Một số trường hợp nhạy cảm như: giá trị đơn hàng lớn, thời gian giao hàng buổi tối, địa chỉ giao hàng trong ngõ, khu vực xa trung tâm.. Nhân viên bán hàng sẽ kiểm tra và thoả thuận thêm, thống nhất cách thức giao hàng cụ thể.</p><p><strong>2 - Thanh toán chuyển khoản ngân hàng - giao hàng qua dịch vụ chuyển phát nhanh:</strong></p><p>- Với các địa chỉ không thuộc phạm vi nêu trên, khách hàng có thể thanh toán trước 100% giá trị sản phẩm qua một trong các tài khoản của BABU.<br>- Ngay sau khi nhận được tiền thanh toán qua chuyển khoản, nhân viên tư vấn sẽ gọi điện thông báo trực tiếp tới khách hàng và hẹn ngày giờ giao hàng. Tuỳ theo địa chỉ của khách hàng mà thời gian giao hàng có thể từ 12 đến 72 giờ.<br>- Trong trường hợp giao hàng chậm trễ mà không báo trước, khách hàng có thể huỷ đơn hàng và BABU sẽ hoàn trả toàn bộ số tiền mà khách hàng đã trả trong thời gian 07 ngày.<br>- Sản phẩm có giá trị bao gồm thuế Giá trị gia tăng trên 20 triệu VNĐ, theo Luật thuế GTGT do Nhà nước ban hành cần thanh toán chuyển khoản. Khách hàng có thể gọi cho nhân viên để được tư vấn chi tiết tại đây.</p><p><strong>3 - Giao hàng và thanh toán trực tiếp tại Showroom/Đại lý của BABU:</strong></p><p>- Khách hàng có thể yêu cầu giữ hàng tại store BABU.<br>- Sản phẩm sẽ được chuẩn bị đầy đủ sau không quá 04 giờ, và được giữ lại tại cửa hàng không quá 12 giờ kể từ khi nhân viên tư vấn bán hàng xác nhận đơn đặt hàng của khách hàng.</p><p><strong>4 - Phí vận chuyển + phí bảo hiểm sản phẩm:</strong></p><p>- Phí vận chuyển: Miễn phí toàn quốc nếu là đươn hàng 800k trở lên, tính phí đối với các mặt hàng khác hoặc tùy theo thỏa thuận.<br>- Phí bảo hiểm sản phẩm: Đối với các sản phẩm khi chuyển hàng thông qua bên thứ 3 là công ty có ký hợp đồng vận chuyển với BABU, khách hàng thanh toán khoản phí bảo hiểm sản phẩm tùy theo giá trị của sản phẩm. Trong quá trình vận chuyển nếu xảy ra hỏng hóc, mất mát, khách hàng sẽ được đền bù 100% giá trị sản phẩm tại thời điểm xuất bán nếu đóng bảo hiểm.<br><strong>5 - Các trường hợp khác:</strong></p><p>- Khách hàng có yêu cầu chuyển hàng qua bên thứ 3 khác như nhà xe, người quen, hoặc đơn vị vận chuyển không ký hợp đồng trực tiếp với BABU. Chi phí và mọi rủi ro trong quá trình vận chuyển do khách hàng chịu. Khi nhân viên giao hàng BABU bàn giao sản phẩm cho bên thứ 3, thì khách hàng và đối tác vận chuyển của khách hàng cần xác nhận bằng điện thoại, tin nhắn SMS hoặc trên phiếu xuất hàng của BABU.</p>', '<h1>I. Chính sách vận chuyển</h1><p>- Giao hàng miễn phí trên toàn quốc đối với sản phẩm trên 800 nghìn đồng</p><p>Đối với khách hàng ở ngoại tỉnh hoặc có yêu cầu chuyển phát thì chúng tôi sẽ chuyển phát nhanh đến tận nơi cho khách hàng.</p><p>- Giao hàng có phí vận chuyển với các đơn dưới 800 nghìn đồng, đồng giá 30K</p><p>II. Hiệu lực</p><p>Chính sách này không áp dụng đối với hàng hóa là quà tặng, hàng khuyến mại. Các chương trình khuyến mại không áp dụng đồng thời (nhưng không bao gồm khuyến mại ở mục I của chính sách này), ưu tiên khuyến mại lớn nhất dành cho khách hàng tại thời điểm giao dịch.</p><p>III. Thời gian giao hàng</p><p>Thời gian giao hàng tại Nội thành Hồ Chí Minh từ 3-10 giờ đồng hồ tính từ thời điểm xác nhận đơn hàng với khách hàng.<br>Thời gian giao hàng COD ở các tỉnh, thành phố sẽ tuỳ thuộc vào từng địa chỉ của khách hàng, bộ phận xử lý đơn hàng sẽ báo cụ thể với khách hàng (Trung bình khoảng 2 – 5 ngày làm việc)<br>Trong trường hợp khách hàng cần vận chuyển HỎA TỐC thì quý khách vui lòng trao đổi với nhân viên bán hàng sẽ tư vấn cụ thể.</p><p>Các trường hợp đặc biệt, khách hàng vui lòng liên hệ với hotline 0355198659</p><p>Lưu ý: Vào thời gian cao điểm (lễ, tết), hoặc tùy theo một số điều kiện khách quan (như thiên tai, hỏng hóc phương tiện, v.v…), chúng tôi không thể giao hàng ngay nên sẽ thỏa thuận thời gian giao hàng cụ thể cho quý khách.</p><p>Xin chân thành cảm ơn quý khách hàng đã tin cậy và sử dụng dịch vụ của chúng tôi!</p><p><br></p>', '<p><strong>BABU</strong> bảo hành qua số điện thoại đặt hàng của quý khách. Kể từ khi xuất kho, hệ thống sẽ tự tạo phiếu bảo hành cho sản phẩm của quý khách theo thời gian bảo hành đã thông báo trên website (trừ các sản phẩm không sử dụng điện như keycap, núm xoay, dụng sụ mods, switch, v.v.v)</p><p><strong>A. Địa điểm bảo hành:</strong></p><p>- Toàn bộ sản phẩm được phân phối và bán lẻ bởi BABU đều được bảo hành tại địa chỉ của BABU</p><p>- Đối với những đơn hàng mua hàng từ xa, quý khách vui lòng gọi điện, nhắn tin qua Fanpage, Shopee, Zalo để được BABU hỗ trợ xác định tình trạng sản phẩm</p><p>- Với các trường hợp bảo hành từ xa, quy trình bảo hành thực hiện như sau:</p><p>+ Quý khách vui lòng đóng gói kỹ sản phẩm để đảm bảo an toàn khi vận chuyển hàng. THE BABU sẽ không chịu trách nhiệm khi có các lỗi phát sinh do quá trình vận chuyển.</p><p>+ Bên ngoài kiện hàng vui lòng ghi Tên, SĐT và Địa chỉ của quý khách để shop tiện liên lạc và gửi hàng lại.</p><p>- Gửi sản phẩm về địa chỉ của BABU . Chi phí chuyển phát chiều gửi đi quý khách vui lòng tự thanh toán.</p><p>- Sau khi bảo hành xong, BABU sẽ liên hệ gửi lại sản phẩm về địa chỉ mà quý khách cung cấp. Chi phí vận chuyển chiều gửi lại do BABU thanh toán</p><p><strong>B. Những trường hợp sau không được bảo hành:</strong></p><p>- Các sản phẩm không còn nguyên tem niêm phong, tem QC, có hiện tượng bị tháo rời để tự ý can thiệp vào kết cấu bên trong của sản phẩm.</p><p>- Sử dụng nguồn sạc điện trực tiếp đối với các thiết bị không dây, dẫn tới hỏng hóc linh kiện và chức năng sử dụng pin của bàn phím</p><p>- Hư hỏng do tác động vật lý của người tiêu dùng như rơi vỡ, va chạm, vào nước, ẩm thấp, chập cháy.</p><p>- Hư hỏng do thiên tai, động vật, công trùng và do con người gây ra;</p><p>- Hiện tượng rỉ sét do yếu tố thời tiết, độ ẩm, thói quen người dùng đều không được bảo hành;</p><p>- Hết thời hạn bảo hành kể từ ngày nhận được hàng;</p><p>- Khách hàng tự ý can thiệp vào firmware của sản phẩm.</p><p><strong>C. Các trường hợp khác sẽ được bảo hành theo tiêu chuẩn của nhà sản xuất.</strong></p><p>- Cụ thể với bàn phím cơ sẽ được bảo hành các lỗi phát sinh do nhà sản xuất mà không phải do người dùng: Hỏng mạch, chết led, lỗi kết nối.</p><p>- Các sản phẩm không sử dụng điện như Keycap, Switch, Keypuller, Swich Puller, Lube Station... đều không bảo hành</p>', '<p><strong>1. Mục đích và phạm vi thu thập</strong></p><p>Cảm ơn Quý khách đã truy cập vào website của chúng tôi, để sử dụng dịch vụ tại website, Quý khách có thể được yêu cầu đăng ký thông tin cá nhân với chúng tôi như:</p><p>- Họ và tên, địa chỉ liên lạc</p><p>- Email, số điện thoại di dộng</p><p>Chúng tôi cũng có thể thu thập thông tin về số lần viếng thăm website của chúng tôi bao gồm số trang Quý khách xem, số links Quý khách click và các thông tin khác liên quan đến việc kết nối đến địa chỉ chỉ thebabustore.vn…</p><p><strong>2. Phạm vi sử dụng thông tin</strong></p><p>thebabustore.vn thu thập và sử dụng thông tin cá nhân với mục đích phù hợp và hoàn toàn tuân thủ “chính sách bảo mật” này. Chúng tôi chỉ sử dụng thông tin của Quý khách trong nội bộ công ty hoặc có thể công bố cho bên thứ 3 như các đại lý, các nhà cung cấp dịch vụ khác nhằm cung cấp dịch vụ tốt nhất, tối ưu nhất cho Quý khách.</p><p>Khi cần thiết chúng tôi có thể sử dụng những thông tin này để liên hệ trực tiếp với Quý khách như gửi thư ngỏ, đơn đặt hàng, thư cảm ơn, thôn tin về kỹ thuật và bảo mật, thông tin về khuyến mại, thông tin về sản phẩm dịch vụ mới….</p><p><strong>3. Thời gian lưu trữ thông tin</strong></p><p>Các thông tin của Quý khách hàng sẽ được lưu trữ&nbsp; trong hệ thống nội bộ của công ty chúng tôi cho đến khi Quý khách có yêu cầu hủy bỏ các thông tin đã cung cấp.</p><p><strong>4. Địa chỉ của đơn vị thụ thập và quản lý thông tin cá nhân</strong></p><p>Hộ Kinh Doanh The BaBu Store</p><p>Địa chỉ: 183 HT44 phường Hiệp Thành Quận 12</p><p>Điện thoại: 0355.198.659</p><p><strong>5. Phương tiện và công cụ để người dùng tiếp cận và chỉnh sửa dữ liệu cá nhân</strong></p><p>Quý khách muốn chỉnh sửa thông tin cá nhân của mình vui lòng liên hệ tổng đài chăm sóc khách hàng của chúng tôi qua số điện thoại:&nbsp; 0355.198.659 hoặc qua địa chỉ email: <a href=\"mailto:kicap.vn@gmail.com\"><span style=\"text-decoration: underline;\">kicap.vn@gmail.com</span></a></p><p><strong>6. Cam kết bảo mật thông tin cá nhân khách hàng</strong></p><p>Chúng tôi cam kết bảo mật thông tin của Quý khách hàng bằng mọi hình thức có thể theo chính bảo vệ thông tin cá nhân của chúng tôi.</p><p>Chúng tôi tuyệt đối không chia sẻ thông tin của Quý khách cho bất cứ công ty hay bên thứ 3 nào khác ngoại trừ các đại lý và các nhà cung cấp liên quan đến việc cung cấp dịch vụ cho Quý khách hàng.</p>', '<p>A. Chính sách đổi hàng</p><p>- The BABU chỉ hỗ trợ đổi hàng trong trường hợp sản phẩm của quý khách được mua tại BABU và còn nguyên tem mac và hình thức như mới trong thời gian tối đa 3 ngày kể từ khi nhận hàng.</p><p>- Đối với các trường hợp sản phẩm lỗi (có video mở hộp khi nhận hàng), BABUhỗ trợ đổi trả trực tiếp cho quý khách sản phẩm mới trong 15 ngày đầu tiên sử dụng, chỉ áp dụng với các sản phẩm trong danh mục bảo hành. Tham khảo chính sách bảo hành của BABU.</p><p>B. Chính sách trả hàng hoàn tiền</p><p>- BABUhỗ trợ trả hàng hoàn tiền cho quý khách đối với bất cứ đơn hàng nào mà quý khách không hài lòng về chất lượng sản phẩm với điều kiện sản phẩm của quý khách còn nguyên tem mác, chưa rơi vỡ hay can thiệp vào bên trong phần cứng và phầm mềm của sản phẩm.</p><p>- Hình thức hoàn tiền: The BABU sẽ chuyển khoản lại cho quý khách ngay khi nhận được hàng.</p><p>- Đối với các đơn hàng ở xa, quý khách xin vui lòng thanh toán phí vận chuyển khi gửi trả hàng lại cho THE BABU.</p>', '<p>THE BABU STORE</p><p><br></p><p><figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image&quot;,&quot;height&quot;:240,&quot;url&quot;:&quot;http://localhost:8000/bizweb.dktcdn.net/thumb/medium/100/436/596/files/z2645819303628-d961c9e7739b7d89cc51db88ad9e94f6-cef7b3e6-2e49-4f7c-a53e-d0d933c58ec6.jpg?v=1631202888004&quot;,&quot;width&quot;:240}\" data-trix-content-type=\"image\" class=\"attachment attachment--preview\"><img src=\"http://localhost:8000/bizweb.dktcdn.net/thumb/medium/100/436/596/files/z2645819303628-d961c9e7739b7d89cc51db88ad9e94f6-cef7b3e6-2e49-4f7c-a53e-d0d933c58ec6.jpg?v=1631202888004\" width=\"240\" height=\"240\"><figcaption class=\"attachment__caption\"></figcaption></figure><br>&nbsp; &nbsp; &nbsp;<figure data-trix-attachment=\"{&quot;contentType&quot;:&quot;image&quot;,&quot;height&quot;:600,&quot;url&quot;:&quot;http://localhost:8000/bizweb.dktcdn.net/thumb/grande/100/436/596/files/158795710-525043295127859-5240130807423059829-n.jpg?v=1631204621672&quot;,&quot;width&quot;:600}\" data-trix-content-type=\"image\" class=\"attachment attachment--preview\"><img src=\"http://localhost:8000/bizweb.dktcdn.net/thumb/grande/100/436/596/files/158795710-525043295127859-5240130807423059829-n.jpg?v=1631204621672\" width=\"600\" height=\"600\"><figcaption class=\"attachment__caption\"></figcaption></figure></p><p><br></p>', '<p>Webgiadung.com cung cấp đa dạng sản phẩm tiện ích và chất lượng giúp mang đến cho bạn cuộc sống hiện đại. Đội ngũ kinh doanh giàu kinh nghiệm luôn sẵn sàng tư vấn, cung cấp các Giải pháp Mua Sắm hiệu quả và tiết kiệm chi phí cho quý khách.</p><p>Mọi chi tiết và giải đáp thắc mắc xin vui lòng liên hệ lại với chúng tôi dưới đây:</p><p>&nbsp;</p><p><strong>CÔNG TY TNHH SIÊU THỊ THÔNG MINH</strong><br>Mã số doanh nghiệp: 0110503197<br>Số điện thoại: 0832.216.580<br>Địa chỉ: Tầng 12, Tòa nhà Licogi 13, Số 164 Đường Khuất Duy Tiến, Phường Nhân Chính, Quận Thanh Xuân, Thành phố Hà Nội, Việt Nam<br>Email: infosieuthithongminh@gmail.com</p><p>&nbsp;</p><p><strong>Showroom bán hàng</strong></p><p>Cửa hàng tại HN: 547 Đ. Xuân Đỉnh, Phường Xuân Đỉnh, Quận Bắc Từ Liêm, TP. Hà Nội<br>Cửa hàng tại HCM: 555 Gia Phú, Phường 3, Quận 6, Thành phố Hồ Chí Minh<br>Hotline: 0832.216.580<br>Email: cskh@webgiadung.com<br>Website: https://webgiadung.com</p><p>Mọi chi tiết và giải đáp thắc mắc xin vui lòng liên hệ lại với chúng tôi qua email: cskh@webgiadung.com</p>', NULL, '2024-10-08 19:52:13', '2024-10-27 02:36:54', '01JB5X7YR1RYRDDR4F8D4QMR5B.png', '04122486001', 'tpb', '123', '123', 'https://shopee.vn/thebabuofficial?entryPoint=ShopBySearch&searchKeyword=the%20babu', '0355198659', '01JB5X7YR4EMWCG99SFQJSDCJJ.svg', '183 HT44 phường Hiệp Thành Quận 12', NULL, '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d23014.03809380152!2d106.6216783372892!3d10.881387527047286!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x317529abda308eb7%3A0x7ceee7f51695bd2!2zVGhlIEJBQlUgU3RvcmUgLSBjaHV5w6puIGLDoW4gYsOgbiBwaMOtbSBjxqEgY3VzdG9t!5e1!3m2!1svi!2s!4v1729942954276!5m2!1svi!2s\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', 'The BABU', 'THEBABUSTORE.VN chuyên cung cấp các loại bàn phím', '01JAPM9H06MBXGH25C3EQRNAJR.png');
